import React from "react";
function Team({ team: team }) {
  const [{ isOver }, drop] = useDrop(() => ({
    accept: "employee",
    collect: (monitor, props) => ({
      isOver: !!monitor.isOver(),
    }),
    drop: (e) => addImageToBoard(e),
  }));
  return (
    <div ref={drop} className="team" key={team.id}>
      <div> {team.Name} </div>
    </div>
  );
}

export default Team;
